<template>
    <div class="container-fluid py-5">
        <div class="container-fluid py-5">
            <h1 class="display-5 mb-4" style="text-align: center;"> Todas las Personas Postuladas </h1>
            <small
                class="d-inline-block fw-bold text-dark text-uppercase bg-light border border-primary rounded-pill px-4 py-1 mb-3">
                Estos son todos los Postulados a Tus Ofertas</small>

            &nbsp;&nbsp;&nbsp;&nbsp;
            <div class="row gx-4 gy-3 d-flex justify-content-center">

                <div class="col-lg-6">
                    <form class="d-none d-md-flex ms-4">
                        <input class="form-control py-3 border-1 text-dark" type="search" placeholder="Buscar"
                            v-model="searchQuery" @input="filterResults" @keypress="onlyNumbers">
                    </form>
                </div>

            </div>
            <div class="mb-3 col-sm-2 col-md-2 col-xl-2">
                <label for="filtroEstado" class="form-label fw-bold text-dark">Filtrar por estado de la
                    postulación:</label>
                <select v-model="filtroEstado" @change="filtrarOfertas" class="form-select text-dark" id="filtroEstado">
                    <option value="todas">Todas</option>
                    <option value="Aceptada">Aceptada</option>
                    <option value="Rechazada">Rechazada</option>
                    <option value="En proceso">En proceso</option>
                </select>
            </div>
            <div class="table-container">
                <table class="table table-hover">
                    <thead>
                        <tr>
                            <th scope="col">Id</th>
                            <th scope="col">Empresa</th>
                            <th scope="col">Oferta</th>
                            <th scope="col">Céd del Postulante</th>
                            <th scope="col">Postulante</th>
                            <th scope="col">Email</th>
                            <th scope="col">Estado</th>
                            <th scope="col">Fecha que Postuló</th>
                        </tr>
                    </thead>
                    <tbody id="contenido">
                        <tr v-if="this.cargando">
                            <td colspan="9">
                                <h3>Cargando....</h3>
                            </td>
                        </tr>
                        <tr v-else v-for="post,  in this.filteredpostulaciones" :key="post.id">

                            <td v-text="post.id"></td>
                            <td v-text="post.Empresa"></td>
                            <td v-text="post.Oferta"></td>
                            <td v-text="post.CIInfPer"></td>
                            <td v-text="post.NombInfPer + ' ' + post.ApellInfPer + ' ' + post.ApellMatInfPer"></td>
                            <td v-text="post.mailPer"></td>
                            <td>
                                <label v-if="post.estado === 'En proceso'" class="text-warning fw-bold">En
                                    Proceso</label>
                                <button v-else-if="post.estado === 'Rechazada'"
                                    class="btn btn-danger fw-bold">Rechazada</button>
                                <button v-else-if="post.estado === 'Aceptada'"
                                    class="btn btn-success fw-bold">Aceptada</button>

                            </td>
                            <!-- Cédula
                            <td>
                                <img v-if="post.imagen" style="width: 100px !important;" :src="post.imagen" class="img-thumbnail" >
                                <img v-else style="width: 100px !important;" src="https://upload.wikimedia.org/wikipedia/commons/thumb/1/12/User_icon_2.svg/480px-User_icon_2.svg.png" class="img-thumbnail" >
                            </td>-->
                            <td>{{ formatFecha(post.created_at) }}</td>
                            <td>

                                <router-link
                                    :to="{ path: '/perfilpostulados/' + post.id + '/' + post.CIInfPer + '/' + post.estado_id }"
                                    class="btn btn-info">
                                    <i class="fa-solid fa-eye"></i>
                                </router-link>

                            </td>
                        </tr>

                    </tbody>
                </table>
            </div>
            <div v-if="filteredpostulaciones.length === 0" class="text-center">
                <h3>No hay Postulaciones</h3>
            </div>
            <br><br>
            <div class="d-flex justify-content-center mb-4">
                <button @click="previousPage" :disabled="currentPage === 1 || buscando"
                    class="btn btn-primary text-white">
                    Anterior
                </button>&nbsp;
                <span class="text-dark">Página {{ currentPage }} de {{ lastPage }}</span>&nbsp;
                <button @click="nextPage" :disabled="currentPage === lastPage || buscando"
                    class="btn btn-primary text-white">
                    Siguiente
                </button>
            </div>
            &nbsp;&nbsp;&nbsp;&nbsp;
            <div class="d-flex justify-content-center mb-4">
                <button class="btn btn-primary text-white" @click="actualizar">Actualizar Datos</button>
                &nbsp;&nbsp;&nbsp;
                <button class="btn btn-primary text-white" @click="descargarCSV">Descargar en formato CSV</button>
                &nbsp;&nbsp;&nbsp;
                <button class="btn btn-primary text-white" @click="descargarXLS">Descargar en formato XLS</button>
            </div>

        </div>
        <br><br>
        <div class="alert alert-info d-flex justify-content-around fw-bold text-dark">
            <div>Total de Postulaciones: {{ totalPost }}</div>
            <div>Postulaciones aceptadas: <span class="text-success">{{ postacepta }}</span></div>
            <div>Postulaciones rechazadas: <span class="text-danger">{{ postrechaza }}</span></div>
            <div>Postulaciones en proceso: <span class="text-warning">{{ postproce }}</span></div>
        </div>
        <br><br>
        <div class="d-flex justify-content-center mb-4">
            <button class="btn btn-primary text-white" @click="mostrargraficoM" v-if="!mostrargrafico">Mostrar Gráfico
                Estadístico</button>
            &nbsp;&nbsp;&nbsp;
            <button class="btn btn-primary text-white" v-if="mostrargrafico" @click="ocultargraficoM">Ocultar Gráfico
                Estadístico</button>
        </div>
        <div class="container mt-5" v-if="mostrargrafico">
            <div class="row gx-4 gy-3 d-flex justify-content-center mt-3">
                <div class="mb-3 col-sm-2">
                    <label class="form-label fw-bold text-dark">Filtrar por Año:</label>
                    <select v-model="filtroAnio" @change="aplicarFiltros" class="form-select text-dark">
                        <option value="">Todos</option>
                        <option v-for="anio in aniosDisponibles" :key="anio" :value="anio">{{ anio }}</option>
                    </select>
                </div>
                <div class="mb-3 col-sm-2">
                    <label class="form-label fw-bold text-dark">Filtrar por Mes:</label>
                    <select v-model="filtroMes" @change="aplicarFiltros" class="form-select text-dark">
                        <option value="">Todos</option>
                        <option v-for="(mes, index) in meses" :key="index" :value="index + 1">{{ mes }}</option>
                    </select>
                </div>
            </div>
            <h4 class="text-center mb-3">Estadísticas de Postulaciones por Oferta</h4>
            <canvas id="graficoPostulaciones" height="100"></canvas>
        </div>
    </div>
    <!-- Cart Page End -->
</template>
<style>
@import url('@/assets/styles/styles.css');
</style>
<script>
import axios from 'axios';
import { useRoute } from 'vue-router';
import { getMe } from '@/store/auth';
import { confimar } from '@/assets/scripts/scriptfunciones/funciones';
import script2 from '@/assets/scripts/custom.js';
import * as XLSX from "xlsx";
import ExcelJS from "exceljs";
import { saveAs } from "file-saver";
import { Chart, registerables } from 'chart.js';
Chart.register(...registerables);

export default {
    data() {
        return {
            idus: 0,
            url213: 'http://backendbolsaempleo.test/api/b_e/vin/postulacions2',
            postulacionespr: [],
            filteredpostulaciones: [],
            searchQuery: '',
            cargando: false,
            currentPage: 1,
            lastPage: 1,
            buscando: false,
            grafico: null,
            totalPost: 0,
            postacepta: 0,
            postrechaza: 0,
            postproce: 0,
            filtroEstado: 'todas',
            mostrargrafico: false,
            filtroMes: '',
            filtroAnio: '',
            aniosDisponibles: [],
            meses: [
                "Enero", "Febrero", "Marzo", "Abril", "Mayo", "Junio",
                "Julio", "Agosto", "Septiembre", "Octubre", "Noviembre", "Diciembre"
            ],
        }
    },
    async mounted() {
        const ruta = useRoute();
        const usuario = await getMe();
        this.idus = ruta.params.id;
        this.getPostulaciones();

    },
    methods: {
        async getPostulaciones() {
            this.cargando = true;
            try {
                const response = await axios.get(`${this.url213}?all=true`, {
                    params: {
                        user_id: this.idus
                    }
                });

                // Verifica si la respuesta tiene datos válidos
                const allData = response.data?.data || [];

                if (allData.length === 0) {
                    console.warn("No se encontraron postulaciones.");
                }

                this.postulacionespr = allData;
                this.contarOfertas();
                this.lastPage = Math.ceil(this.postulacionespr.length / 10);
                this.updateFilteredData();
                if (this.mostrargrafico) {
                    if (this.filtroAnio === '' || this.filtroMes === '') {
                        this.generarGrafico();
                        this.aniosDisponibles = [...new Set(
                            this.postulacionespr.map(o => new Date(o.created_at).getFullYear())
                        )].sort((a, b) => b - a);
                    } else {
                        this.aniosDisponibles = [...new Set(
                            this.postulacionespr.map(o => new Date(o.created_at).getFullYear())
                        )].sort((a, b) => b - a);
                    }
                }
                //this.generarGrafico();
            } catch (error) {
                console.error("Error al obtener postulaciones:", error);
                this.postulacionespr = []; // Asegura que no queden datos anteriores
                this.lastPage = 1;
                this.updateFilteredData();

            } finally {
                this.cargando = false;
            }
        },
        mostrargraficoM() {
            this.mostrargrafico = true;
            this.getPostulaciones();

        },
        ocultargraficoM() {
            this.mostrargrafico = false;
        },
        contarOfertas() {
            this.totalPost = this.postulacionespr.length;
            this.postacepta = this.postulacionespr.filter(ofe => ofe.estado == "Aceptada").length;
            this.postrechaza = this.postulacionespr.filter(ofe => ofe.estado == "Rechazada").length;
            this.postproce = this.postulacionespr.filter(ofe => ofe.estado == "En proceso").length;
        },
        aplicarFiltros() {
            let filtradas = this.postulacionespr;

            if (this.filtroAnio) {
                filtradas = filtradas.filter(ofe =>
                    new Date(ofe.created_at).getFullYear() == this.filtroAnio
                );
            }

            if (this.filtroMes) {
                filtradas = filtradas.filter(ofe =>
                    new Date(ofe.created_at).getMonth() + 1 == this.filtroMes
                );
            }

            // Tabla
            this.filteredpostulaciones = filtradas;

            this.lastPage = Math.ceil(this.filteredpostulaciones.length / 10);
            this.currentPage = 1;
            this.filteredpostulaciones = this.filteredpostulaciones.slice(0, 10);

            this.generarGrafico(filtradas);
        },
        generarGrafico(postuladosData = this.postulacionespr) {
            const conteoOfertas = {};
            const conteoaprobados = {};
            const conteonoaprobados = {};

            postuladosData.forEach(post => {
                //const clave = `${post.Oferta} - ${post.estado}`;
                if (!conteoOfertas[post.Oferta]) {
                    conteoOfertas[post.Oferta] = 0;
                    conteoaprobados[post.Oferta] = 0;
                    conteonoaprobados[post.Oferta] = 0;
                }
                conteoOfertas[post.Oferta]++;
                if (post.estado === 'Aceptada') {
                    conteoaprobados[post.Oferta]++;
                } else {
                    conteonoaprobados[post.Oferta]++;
                }
            });

            const keyofertas = Object.keys(conteoOfertas);
            const ofertas = Object.values(conteoOfertas);
            const datosAprobados = Object.values(conteoaprobados);
            const datosNoAprobados = Object.values(conteonoaprobados);

            if (this.grafico) {
                this.grafico.destroy(); // Si ya existe, destrúyelo antes de crear otro
            }

            const ctx = document.getElementById('graficoPostulaciones');
            const colores1 = "hsl(120, 80%, 50%)";
            const colores2 = "hsl(150, 70%, 40%)";
            const colores3 = "hsl(0, 80%, 50%)";
            this.grafico = new Chart(ctx, {
                type: 'bar', // También puedes probar con 'pie', 'doughnut', 'radar', etc.
                data: {
                    labels: keyofertas,
                    datasets: [
                        {
                            label: 'Postulados',
                            data: ofertas,
                            backgroundColor: colores1,
                            borderColor: colores1,
                            borderWidth: 1
                        },
                        {
                            label: 'Aceptadas',
                            data: datosAprobados,
                            backgroundColor: colores2,
                            borderColor: colores2,
                            borderWidth: 1
                        },
                        {
                            label: 'Rechazadas',
                            data: datosNoAprobados,
                            backgroundColor: colores3,
                            borderColor: colores3,
                            borderWidth: 1
                        }
                    ]
                },
                options: {
                    responsive: true,
                    scales: {
                        y: {
                            beginAtZero: true,
                            stepSize: 1
                        }
                    }
                }
            });
        },

        async descargarXLS() {
            const workbook = new ExcelJS.Workbook();
            const worksheet = workbook.addWorksheet("Postulaciones");

            // ===============================
            // 1️⃣ Insertar encabezado con combinación
            // ===============================
            worksheet.mergeCells("A1:H1");
            worksheet.getCell("A1").value =
                'UNIVERSIDAD "TÉCNICA LUIS VARGAS TORRES" DE ESMERALDAS';
            worksheet.getCell("A1").alignment = { horizontal: "center", vertical: "middle" };
            worksheet.getCell("A1").font = { bold: true, size: 14 };

            worksheet.mergeCells("A2:H2");
            worksheet.getCell("A2").value = "DIRECCIÓN DE VINCULACIÓN CON LA SOCIEDAD";
            worksheet.getCell("A2").alignment = { horizontal: "center" };
            worksheet.getCell("A2").font = { bold: true, size: 12 };

            worksheet.mergeCells("A3:H3");
            worksheet.getCell("A3").value = "Esmeraldas - Ecuador";
            worksheet.getCell("A3").alignment = { horizontal: "center" };

            worksheet.mergeCells("A4:H4");
            worksheet.getCell("A4").value = "Datos Estadísticos - Bolsa de Empleo";
            worksheet.getCell("A4").alignment = { horizontal: "center" };

            worksheet.mergeCells("A5:H5");
            worksheet.getCell("A5").value = "Estudiantes Graduados Postulados a ofertas de empleo";
            worksheet.getCell("A5").alignment = { horizontal: "center" };

            // ===============================
            // 2️⃣ Insertar imágenes (logo izquierda y derecha)
            // ===============================
            const logoIzq = workbook.addImage({
                base64: "data:image/png;base64,", // tu imagen en base64
                extension: "png"
            });

            const logoDer = workbook.addImage({
                base64:"data:image/png;base64,",
                extension:"png"
            });

            // Insertar en posiciones
            worksheet.addImage(logoIzq, {
                tl: { col: 0, row: 0 },
                ext: { width: 80, height: 80 },
            });
            worksheet.addImage(logoDer, {
                tl: { col: 7, row: 0 },
                ext: { width: 80, height: 80 },
            });

            // ===============================
            // 3️⃣ Encabezados de la tabla
            // ===============================
            const headers = [
                "ID",
                "Empresa",
                "Oferta",
                "Cédula",
                "Apellidos",
                "Email",
                "Fecha de Postulación",
                "Estado",
            ];

            worksheet.addRow(headers);

            // Estilo de headers (verde con texto blanco y bordes)
            const headerRow = worksheet.getRow(6);
            headerRow.eachCell((cell) => {
                cell.fill = {
                    type: "pattern",
                    pattern: "solid",
                    fgColor: { argb: "006400" }, // verde oscuro
                };
                cell.font = { bold: true, color: { argb: "FFFFFF" } }; // blanco
                cell.alignment = { horizontal: "center", vertical: "middle" };
                cell.border = {
                    top: { style: "thin" },
                    left: { style: "thin" },
                    bottom: { style: "thin" },
                    right: { style: "thin" },
                };
            });

            // ===============================
            // 4️⃣ Agregar datos
            // ===============================
            this.filteredpostulaciones.forEach((post) => {
                worksheet.addRow([
                    post.id,
                    post.Empresa,
                    post.Oferta,
                    post.CIInfPer, // cédula
                    post.NombInfPer +
                    " " +
                    post.ApellInfPer +
                    " " +
                    post.ApellMatInfPer,
                    post.mailPer,
                    new Date(post.created_at).toLocaleString("es-EC", {
                        timeZone: "America/Guayaquil",
                    }),
                    post.estado,
                ]);
            });

            // Forzar columna Cédula como texto
            worksheet.getColumn(4).eachCell((cell, rowNumber) => {
                if (rowNumber > 6) {
                    cell.numFmt = "@"; // texto
                }
            });

            // ===============================
            // 5️⃣ Bordes y ajuste automático
            // ===============================
            worksheet.eachRow((row, rowNumber) => {
                if (rowNumber >= 6) {
                    row.eachCell((cell) => {
                        cell.border = {
                            top: { style: "thin" },
                            left: { style: "thin" },
                            bottom: { style: "thin" },
                            right: { style: "thin" },
                        };
                    });
                }
            });

            worksheet.columns.forEach((col, i) => {
                let maxLength = 0;

                // Verificar longitud del header
                const header = headers[i];
                if (header) {
                    maxLength = header.toString().length;
                }

                // Verificar longitud de los datos
                col.eachCell({ includeEmpty: true }, (cell) => {
                    const columnLength = cell.value ? cell.value.toString().length : 0;
                    if (columnLength > maxLength) {
                        maxLength = columnLength;
                    }
                });

                // Asignar ancho (un poco más grande para aire visual)
                col.width = maxLength + 2;
            });

            // ===============================
            // 6️⃣ Exportar archivo
            // ===============================
            const buffer = await workbook.xlsx.writeBuffer();
            saveAs(new Blob([buffer]), "EstudiantesPostulados.xlsx");
        },

        descargarCSV() {
            const headers = ['ID', 'Empresa', 'Oferta', 'Cédula', 'Apellidos', 'Email', 'Fecha de Postulación', 'Estado'];
            const rows = this.filteredpostulaciones.map(post => [
                post.id,
                post.Empresa,
                post.Oferta,
                post.CIInfPer,
                post.NombInfPer + ' ' + post.ApellInfPer + ' ' + post.ApellMatInfPer,
                post.mailPer,
                new Date(post.created_at).toLocaleString('es-EC', { timeZone: 'America/Guayaquil' }),
                post.estado
            ]);

            let csvContent = 'data:text/csv;charset=utf-8,\uFEFF';
            csvContent += headers.join(';') + '\n';
            rows.forEach(row => {
                csvContent += row.join(';') + '\n';
            });

            const encodedUri = encodeURI(csvContent);
            const link = document.createElement('a');
            link.setAttribute('href', encodedUri);
            link.setAttribute('download', 'EstudiantesPostulados.csv');
            document.body.appendChild(link);
            link.click();
            document.body.removeChild(link);
        },
        filtrarOfertas() {
            this.currentPage = 1; // Reinicia a la primera página
            this.updateFilteredData();
        },

        updateFilteredData() {
            // Aplicar paginación local
            let filtradas = this.postulacionespr;

            if (this.filtroEstado === 'Aceptada') {
                filtradas = filtradas.filter(ofe => ofe.estado == "Aceptada");
            } else if (this.filtroEstado === 'Rechazada') {
                filtradas = filtradas.filter(ofe => ofe.estado == "Rechazada");
            } else if (this.filtroEstado === 'En proceso') {
                filtradas = filtradas.filter(ofe => ofe.estado == "En proceso");
            }

            // Aplicar paginación local
            const startIndex = (this.currentPage - 1) * 10;
            const endIndex = startIndex + 10;
            this.filteredpostulaciones = filtradas.slice(startIndex, endIndex);

            // Actualizar total de páginas (si quieres que se actualice también el número de páginas)
            this.lastPage = Math.ceil(filtradas.length / 10);
        },
        actualizar() {
            this.cargando = true;
            this.filtroEstado = 'todas';
            this.getPostulaciones()
        },
        filterResults() {
            const query = this.searchQuery.trim();
            if (query) {
                this.buscando = true;
                this.filteredpostulaciones = this.postulacionespr.filter(inves =>
                    inves.CIInfPer.includes(query)
                );
            } else {
                this.buscando = false;
                this.actualizar();
            }
        },
        onlyNumbers(event) {
            const charCode = event.which ? event.which : event.keyCode;
            if (charCode < 48 || charCode > 57) {
                event.preventDefault();
            }
        },
        nextPage() {
            if (this.currentPage < this.lastPage) {
                this.currentPage++;
                this.updateFilteredData();
            }
        },
        previousPage() {
            if (this.currentPage > 1) {
                this.currentPage--;
                this.updateFilteredData();
            }
        },
        eliminar(id, nombre) {
            confimar('http://backendbolsaempleo.test/api/b_e/vin/postulacions/', id, 'Eliminar registro', '¿Realmente desea eliminar a ' + nombre + '?');
            this.cargando = false;
            this.$router.push('/principal/' + this.idus);

        }
    },
    mixins: [script2],
    name: 'allpostulados',
}
</script>